'use strict';

// MODULES //

var dtypes = require( '@stdlib/types/ndarray/base/dtypes' );


// VARIABLES //

var DTYPES = dtypes();
var len = DTYPES.length;


// MAIN //

/**
* Returns a constructor cache.
*
* @private
* @returns {Object} constructor cache
*/
function cache() {
	var out;
	var i;

	out = {};
	for ( i = 0; i < len; i++ ) {
		out[ dtypes[ i ] ] = [];
	}
	return out;
} // end FUNCTION cache()


// EXPORTS //

module.exports = cache;
